import ExpenseItem from "./ExpenseItem";

import "./ExpenseList.css";
const ExpenseList = (props) => {
  let mappinpContent = <p>No items found</p>;
  if (props.items.length === 0) {
    return <h2>Found No Items</h2>;
  }
  return <div></div>;
  return props.items.map((pramter) => {
    //render items
    return (
      <ExpenseItem
        key={pramter.id}
        title={pramter.title}
        amount={pramter.amount}
        date={pramter.date}
      />
    );
  });
};
export default ExpenseList;
